export const ROUTES = {
  home: '/home',
  contact: '/contact',
  login: '/login',
  signUp: '/sign-up',
  product: '/product',
  detail: '/detail',
  profile: '/profile',
  forgotPassword: '/forgot-password',
  employee: '/employee',
  add: '/employee/create-or-update',
  update: (id: string | number) => ({
    path: `/employee/create-or-update/${id}`,
    id: id,
  }),
};
